import React from "react";
import {  BrowserRouter as Router ,Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/articles">Articles</Link>
        </li>
        <li>
          <Link to="/articles-all">All articles</Link>
        </li>
      </ul>
    </nav>
  );
};
export default Navbar;
